from sqlalchemy.orm import Session
from schemas import UserRegistar
from db.repository.user_repo import get_id_role, create_user


def registar_utilizador(db: Session,user: UserRegistar):
    role_id = get_id_role(db,user.role)
    user.foto = ""
    salt ="DEVESI"
    create_user(db, user, role_id, salt)
    return True
